import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import Routes
import MyTeam from './myteam/index.js'; // Adjust the path as needed
import './App.css';

function App() {
  return (
    <Router>
      <Routes> 
        <Route path="/" element={<MyTeam />} /> 
      </Routes>
    </Router>
  );
}

export default App;
